import React from 'react'
import { motion } from 'framer-motion';

const aboutVariants = {
  hidden: {
    opacity: 0,
    y: '-100vh',
  },
  hidden2: {
    opacity: 0,
    y: '100vh',
  },
  visible: {
    opacity: 1,
    y: 0,
    transition: {
      type: 'spring',
      // delay: 0.5,
    },
  },
};

export default function Header() {
  return (
    <div className="header">
      <motion.div position="static">
        <img src={process.env.PUBLIC_URL + '/logo.png'} alt="logo" className="logo"/>
      </motion.div>
      Header!
    </div>
  );
}
